import { inject } from '@angular/core';
import { Router } from '@angular/router';
import { AuthStatus } from 'app/interfaces/AuthStattusEnum';
import { AuthService } from 'app/services/auth.service';
export const isAuthenticatedGuard = (route, state) => {
  const authService = inject(AuthService);
  const router = inject(Router);
  if (authService.getCheckStatus() == AuthStatus.authenticate) {
    return true;
  }
  if (authService.getCheckStatus() == AuthStatus.checking) {
    //router.navigateByUrl('/pages/login');
    return false;
  }
  const url = state.url;
  localStorage.setItem('url', url);
  router.navigateByUrl('/pages/login');
  return false;
};
